import Home from './routes/home/home.components';
import { Route,Routes } from 'react-router-dom';
function App() {
  return (
    <Routes>
      <Route path='/' element ={<Home/>}/>
    <div className='categories-container '>
      <Home/>
    </div>
    </Routes>
  );
}

export default App;
